    false,nt"url": null,nt"notes": "Funding from this grant will allow for
    the purchase of biocontrol agents and chemicals to facilitate the rapid response
    phase of the project and to provide funds to hire an independent contractor through
    the Refugeu2019s Friendu2019s Group. 3 SCA interns and an AmeriCorps volunteer were
    trained on the refuge invasive survey protocol and 1000 acres were systematically
    surveyed. All data was entered into the refuge GIS and maps were produced of significant
    weed occurrences. Chemicals and Biocontrol agents were also applied to 140 acres.
    A Cooperative Agreement with the refuges friends group was initiated to fund weed
    volunteer coordinator. This position will be filled in 2012. Several hundred volunteers
    also assisted with restoration effortsinvolving the control of reed canarygrass
    and the planting of native trees and shrubs on 2.5 acres of riparian habitat.",nt"owner_org":
